import React from "react";
import { Container, Card } from "react-bootstrap";

const Dashboard = () => {
  return (
    <Container className="mt-5">
      <Card className="p-4">
        <h1>Welcome to the Dashboard</h1>
        <p>User Dashboard</p>
      </Card>
    </Container>
  );
};

export default Dashboard;
